import './App.css';
import { Login, Protected, Dashboard, Contact, Blog } from './Components';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import React from 'react';

function App() {
  return (
    <div className="App">
      {/* <header className="App-header">
                  <img src={logo} className="App-logo" alt="logo" />
                  <p>
                    Edit <code>src/App.js</code> and save to reload.
                  </p>
                  <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                  >
                    Learn React
                  </a>
                </header> */}
      <BrowserRouter>
        <Routes>
          <Route 
            path="/login" 
            element={
            <Login />
            } />
          <Route
            path="/"
            element={
            <Protected>
              <Dashboard />
            </Protected>
          } />
          <Route 
            path="/blog" 
            element={
            <Protected>
              <Blog />
            </Protected>
            } />
          <Route 
            path="/contact" 
            element={
            <Protected>
              <Contact />
            </Protected>
            } />
        </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
